import React, { useState, useEffect } from "react";
function App() {
  const [data, setData] = useState([{}]);

  useEffect(() => {
    fetch("/members")
      .then((res) => res.json())
      .then((data) => {
        setData(data);
        console.log(data);
      });
  }, []);

  return (
    <div className="font-kanit text-white">
      <div className="bg-red flex justify-center">
        <div className="items-center flex w-11/12 justify-between my-3">
          <div className="">
            <a href="/">
              <img src=""></img>
            </a>
            <p className="">
              สามารถสั่งอาหารได้ <strong>10:00 - 19:45 น.</strong>
            </p>
          </div>
          <div className="font-semibold border-2 place-content-centerr">
            <h1 className="text-3xl">Welcome to <strong>MK Online Delivery</strong></h1>
            <div className="flex">
            <button class="btn btn-primary">Button</button>
            <button class="btn btn-primary">Button</button>
            </div>
            <div>
              <input type="text" placeholder="ค้นหาสถานที่เพื่อตรวจสอบพื้นที่จัดส่ง" autoComplete="off"></input>
            </div>
          </div>
          <div className="">
            <a href="/login">
              <div className="">
                <i>
                  เข้าสู่ระบบ/ลงทะเบียน
                </i>
              </div>
            </a>
            <div>
              <div className="lang-select"></div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
